import { EventContext, Styled } from "direflow-component";
import React, { FC, useContext } from "react";
import styles from "./App.css";

interface IProps {
  title: string;
}

const App: FC<IProps> = (props) => {
  const dispatch = useContext(EventContext);

  return (
    <Styled styles={styles}>
      <div>Hello World</div>
    </Styled>
  );
};

App.defaultProps = {
  title: "Direflow Test",
};

export default App;
